import React from "react";
import "./Nav.css";

export default class Header extends React.Component {
  render() {
    return (
      <nav className="nav-container">
        <div>SCENE STAMP</div>
        <div>
          <div>Home</div>
          <div>Watch</div>
        </div>
      </nav>
    );
  }
}
